import React,{useEffect} from 'react';
import{Link} from 'react-router-dom';
import './Home1.css';
import image1 from '../assets/image1.jpg';



export function Home1(){
    
    useEffect(() => {
        // Créer une instance de l'IntersectionObserver
        const observer = new IntersectionObserver((entries) => {
          entries.forEach((entry) => {
            if (entry.isIntersecting) {
              entry.target.classList.add('show');
            } else {
              entry.target.classList.remove('show');
            }
          });
        });
    
        // Sélectionnez les éléments que vous souhaitez observer
        const elementsToObserve = document.querySelectorAll('.premierpartie');
    
        // Observer chaque élément
        elementsToObserve.forEach((element) => {
          observer.observe(element);
        });
     // Nettoyer l'observer lorsqu'il n'est plus nécessaire
     return () => {
        elementsToObserve.forEach((element) => {
          observer.unobserve(element);
        });
      };
    }, []); // Le tableau vide signifie que ce code ne s'exécute qu'une fois lors du montage du composant
      
    return(
        <>
        <div className="premierpartie">
         <div className="container1">
        <p className="title1">TOP BRANDS</p>
        <h1>NEW COLLECTION</h1>
        <p className="title2">Lorem ipsum dolor at mind,constructeur pedagore</p>
        <button className="button1">SHOP NOW</button>
        <img src={image1} alt='image1'/>
       

       </div>
      
     
    
   
    <div className="container2">
        
        <ul>
            <div className="actif">
            <i className="fas fa-folder"></i>
            <li><Link to="/" className='Links'>Categories</Link></li>
            </div>
            <div className="reste">
            <i className="fas fa-home"></i>
            <li><Link to="/Home" className='Links'>Home</Link></li>
            </div>
            <div className="reste">
            <i className="fas fa-tshirt"></i>
            <li><Link to="/Clothing" className='Links'>Clothing</Link></li>
            </div>
            <div className="reste">
            <i className="fas fa-desktop"></i>
            <li><Link to="/Electronics" className='Links'>Electronics</Link></li>
            </div>
            <div className="reste">
            <i className="fas fa-clock"></i>
            <li><Link to="/Watches" className='Links'>Watches</Link></li>
            </div>
            <div className="reste">
            <i className="fas fa-shoe-prints"></i>
            <li><Link to="/Shoes" className='Links'>Shoes</Link></li>
            </div>
            <div className="reste">
            <i className="fas fa-blog"></i>
            <li><Link to="/Blog" className='Links'>Blog</Link></li>
            </div>
            <div className="reste">
            <i className="fas fa-envelope"></i>
            <li><Link to="/Contact" className='Links'>Contact</Link></li>
            </div>
        </ul>
    </div>


</div>

        
        
        
        </>
    )

}
